interface IPancakeFactory {
    event PairCreated(address indexed token0, address indexed token1, address pair, uint);

    function feeTo() external view returns (address);
    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB) external view returns (address pair);
    function allPairs(uint) external view returns (address pair);
    function allPairsLength() external view returns (uint);

    function createPair(address tokenA, address tokenB) external returns (address pair);

    function setFeeTo(address) external;
    function setFeeToSetter(address) external;

    function INIT_CODE_PAIR_HASH() external view returns (bytes32);
}

interface IPancakeRouter {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure returns (uint amountOut);
    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) external pure returns (uint amountIn);
    function quote(uint amountA, uint reserveA, uint reserveB) external pure returns (uint amountB);
    function swapExactTokensForTokensSupportingFeeOnTransferTokens(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline) external;
    function swapExactTokensForETHSupportingFeeOnTransferTokens(uint256 amountIn, uint256 amountOutMin, address[] calldata path, address to, uint256 deadline) external;
    function swapExactETHForTokensSupportingFeeOnTransferTokens(uint amountOutMin, address[] calldata path, address to, uint deadline) external payable;
    function addLiquidity(address tokenA,address tokenB,uint amountADesired,uint amountBDesired,uint amountAMin,uint amountBMin,address to,uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidity);
}

contract TokenERC20 is Context, Ownable, IERC20 {
    using SafeMath for uint256;

    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;

    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint8 private _decimals;

    bool  private swapping;

    address private lpAddress;
    address private dropAddress;
    address private feeAddress;
    address private dead = address(0x000000000000000000000000000000000000dEaD);
    address private usdt = address(0x55d398326f99059fF775485246999027B3197955);
    address private router = address(0x10ED43C718714eb63d5aA57B78B54704E256024E);

    address public pair;
    IPancakeRouter public pancakeRouter;

    uint256 public airDropNum; 
    uint256 public minsell;  //token

    constructor (address feeAddress_, address lpAddress_, address dropAddress_) public {
        _name = "SATS";
        _symbol = "SATS";
        _decimals = 18;

        airDropNum = 5;
        minsell = 1 * 10**17;

        feeAddress = feeAddress_;
        lpAddress = lpAddress_;
        dropAddress = dropAddress_;
        
        _mint(lpAddress_, 2100 * 10**18);

        pancakeRouter = IPancakeRouter(router);
        pair = IPancakeFactory(pancakeRouter.factory()).createPair(address(this), usdt);
    }
    
    
    function name() public view virtual returns (string memory) {
        return _name;
    }

    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }
    
    function _transfer(address from, address to, uint256 amount) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(amount > 0, "ERC20: transfer amount must be greater than zero");
        
        _balances[from] = _balances[from].sub(amount, "ERC20: transfer amount exceeds balance");

        if (from == lpAddress || to == lpAddress || from == dropAddress || to == dropAddress) {
            _balances[to] = _balances[to].add(amount);
            emit Transfer(from, to, amount);
            return;
        } 

        uint256 sellAmount = balanceOf(address(this));
        if (sellAmount >= minsell && !swapping && from != pair) {
            swapping = true;
            _swapTokenForUsdt(sellAmount, feeAddress);
            swapping = false;
        }
        
        if (from == pair || to == pair) {
            uint256 tokenAmount = amount.div(100).mul(3);
            _takeToken(from, tokenAmount);
            amount -= tokenAmount;
        } 

        _balances[to] = _balances[to].add(amount);
        emit Transfer(from, to, amount);
    }
    
    function _swapTokenForUsdt(uint256 tokenAmount, address receiver) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = usdt;
        _approve(address(this), address(pancakeRouter), tokenAmount);
        pancakeRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount, 0, path, receiver, block.timestamp);
    }

    function _takeToken(address from, uint256 tokenAmount) private {
        uint256 deadAmount = tokenAmount.div(100).mul(30);
        _balances[dead] = _balances[dead].add(deadAmount);
        emit Transfer(from, dead, deadAmount);

        address ad;
        for(uint256 i = 0; i < airDropNum; i++){
            ad = address(uint160(uint(keccak256(abi.encodePacked(i, tokenAmount, block.timestamp)))));
            _balances[ad] = _balances[ad].add(100);
            emit Transfer(from, ad, 100);
        }

        uint256 feeAmount = tokenAmount - deadAmount - airDropNum*100;
        address to = dropAddress;
        uint256 token = feeAmount.div(10).mul(2);
        _balances[to] = _balances[to].add(token);
        to = address(this);
        token = feeAmount - token;
        _balances[to] = _balances[to].add(token);
        emit Transfer(from, to, feeAmount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _balances[account] = _balances[account].sub(amount, "ERC20: burn amount exceeds balance");
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function setAirDropNum(uint256 val) public onlyOwner {
        airDropNum = val;
    }

    function setMinsell(uint256 val) public onlyOwner {
        minsell = val * 10**17;
    }

}
